    "public-land-survey-system-sections-on-usda-forest-service-lands",nt"isopen":
    false,nt"url": null,nt"notes": "This feature class depicts the boundaries
    of Land Survey features called sections, definednby the Public Lands Survey System
    Grid. Normally, 36 sections make up a township. The entire extentnof each of these
    units should be collected, not just the portion on National Forest System lands.nThis
    dataset is derived from the USFS Southwestern Region ALP (Automated Lands Program)
    datanProject. This is one of six layers derived from ALP for the purpose of supplying
    data layers fornrecourse GIS analysis and data needs within the Forest Service.
    The six layers are SurfacenOwnership, Administrative Forest Boundary, District Boundary,
    Townships, Sections, and Wilderness.nThere were some gapes in the ALP data so a
    small portion of this dataset comes from CCFn(Cartographic Feature Files) datasets
    and the USFS Southwestern Region Core Data Project. ALP datanis developed from data
    sources of differing accuracy, scales, and reliability. Where available it isndeveloped
    from GCDB (Geographic Coordinate Data Base) data. GCDB data is maintained by the
    Bureau ofnLand Management in their State Offices. GCDB data is mostly corner data.
    Not all corners and not allnboundaries are available in GCDB so ALP also utilizes
    many other data sources like CFF data tonderive its boundaries. GCDB data is in
    a constant state of change because land corners are alwaysngetting resurveyed. The
    GCDB data used in this dataset represents a snapshot in time at the time thenGCDB
    dataset was published by the BLM and may not reflect the most current GCDB dataset
    available.nThe Forest Service makes no expressed or implied warranty with respect
    to the character, function,nor capabilities of these data. These data are intended
    to be used for planning and analyses purposesnonly and are not legally binding with
    regards to title or location of National Forest Systemnlands.",nt"license_title":
